measurements.description:
Twenty-three flowers and one bud evenly displayed on one 154-cm arched inflorescence;
sepals dark chartreuse heavily overlaid and veined burgundy, dorsal sepal hooded, lateral sepals swept forward;
petals horizontal, margins slightly recurved, dark chartreuse heavily overlaid and veined burgundy, especially midrib, edges dark chartreuse;
lip cream, keels spotted burgundy, sidelobes overlaid light yellow, spotted burgundy, midlobe spotted burgundy, medial burgundy line;
column light yellow, blushed burgundy dorsally, spotted burgundy ventrally, anther cap yellow;
 substance firm; texture matte, lip velvety; followed bend on lip for length measurement.
